import React from "react";
import View from './View'

const App = () => {
    return (
        <React.Fragment>
            <div className="ui container comments fontifyr">
                <View
                    Username="Sam"
                    UserText="Fuck of"
                />
                <View
                    Username="Drake"
                    UserText="Fuck your mother"
                />
            </div>
        </React.Fragment>
    );
};
export default App;
